I'm excited to be a #DovePartner and to be given the opportunity to create this #DoveBeautyBarBox  This box has some of my favorite @dove Beauty Bars and I've also included 3 Black owned beauty products. The Dove Beauty Bar is a gentle moisturizing cleanser that cares for your skin but also works great as a makeup remover. I started using the Dove Beauty Bar when I was younger, on my face and body - it was the first cleanser I ever owned. It's so crazy to think I've been using it that long. It's timeless! Visit dovebeautybarbox.fooji.com/  for rules and a chance to receive your complimentary box. NO PURCH NEC. Open 50 US/DC, 18+. Ends 6pm ET September 24, 2020. Rules: DoveBeautyBarBox.fooji.com
